import React from 'react';
import { Link} from "react-router-dom";
import App from '../App';

  
const Customer = () => {
  function refreshPage() {
 
  }
  <Link to={{pathname:"/"}} onClick={App}>Home</Link>
  return (
    <div
      style={{
        display: 'flex',
        justifyContent: 'Right',
        alignItems: 'Right',
        height: '100vh'
      }}
    >
      <h1>Welcome to customer page</h1>
    </div>
  );
};
  
export default Customer;
